import { List } from "@mui/material";
import axios from "axios";
import React, { useEffect, useState } from "react";
import {
  SimpleForm,
  SelectInput,
  ArrayInput,
  Edit,
  SimpleFormIterator,
  TextInput,
  useRecordContext,
  Show,
  TextField,
  Datagrid,
} from "react-admin";
import { useSelector } from "react-redux";
import { URI } from "../../URLS";

const StorageShow = (props) => {
  return (
    <List
      title="Create a place"
      //   resource="linkEmployeeAndPlace"
      {...props}

      //   resource="addEmployee"
      //   redirect="/getEmployees"
    >
      <Datagrid>
        <TextField source="blackFrames" />
        <TextField source="media" />
        <TextField source="note" />
        <TextField source="regionId" />
        <TextField source="storageId" />
        <TextField source="timeZone" />
        <TextField source="type" />
      </Datagrid>
    </List>
  );
};

export default StorageShow;
